import React, { useEffect, useState, useRef } from "react";
import { ToastContainer, toast } from "react-toastify";
import{Link} from "react-router-dom";
import "react-toastify/dist/ReactToastify.css";

import imagenLogin from 'media/login.svg';
import Bienvenido from './listaVentas';


function TSolutions() {
    return (
        <div class=" h-full w-full">
            <h2 className='ml-1 mr-4 text-5xl font-semibold text-center text-gray-900'> TSolutions</h2>

            <h4 className='ml-1 mr-4 text-1xl font-semibold text-gray-700 mt-4 p-10 text-left  '>
                Somos una empresa colombiana dedicada a la venta de productos tecnológicos de Alta Gama al por mayor y al mejor precio, somos importadores directos trayéndote lo último en productos tecnológicos. /media/login.479bbcf7.svg
            </h4>
            <div >
                <span className="p-2 font-sick font-semibold text-6xl flex justify-center">T-SOLUTIONS</span>
                <img className="imagenLogo" src={imagenLogin} alt="Logo" />
            </div>
           

        </div>
    );
}

export default TSolutions
